import AppLayout from "../components/AppLayout";
import wrapper from "../store/configureStore";

const Home = () => {
  return (
    <wrapper>
      <AppLayout>
        <div>Hello, Next!</div>
      </AppLayout>
    </wrapper>
  );
};

export default Home;
